import React, { Component } from "react";
import './JxSingapore2019Stats.css'
import styled from 'styled-components';

const TopBigLetter = styled.div`
  font-size: 50px;
  text-align: center;
`

const BottomSmallLetter = styled.div`
  font-size: 20px;
  text-align: center;
`

const InfoComponent = styled.div`
  padding-left: 10px;
  padding-right: 10px;
`


class JxSingapore2019Stats extends Component {
  render() {
    return (
        <div class = "containerHiring"> 
            <div className="flexbox">
            <div className="flexbox-left">Empowering people to create with technology</div>
              {/* <div style={{width:20+'px'}}></div> */}
              <div className="flexbox-right">
                <InfoComponent>
                    <TopBigLetter>12</TopBigLetter>
                    <BottomSmallLetter>sd</BottomSmallLetter>

                </InfoComponent>
                <InfoComponent>
                    <TopBigLetter>12</TopBigLetter>
                    <BottomSmallLetter>sd</BottomSmallLetter>

                </InfoComponent>
              </div>
            </div>
        </div>
    );
  }
}

export default JxSingapore2019Stats;
